import React from "react";
import {
  IonBackButton,
  IonButtons,
  IonContent,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar,
} from "@ionic/react";

import AgentForm from "../../../components/AgentForm/AgentForm";

const AddAgent: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonBackButton defaultHref="/agents" />
          </IonButtons>
          <IonTitle>Add Agent</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <AgentForm buttonName="Add" />
      </IonContent>
    </IonPage>
  );
};

export default AddAgent;
